function FirstWater(props) {
    const month = props.firstWater.toLocaleString('en-US', { month: 'long' })
    const day = props.firstWater.toLocaleString('en-US', { day: '2-digit' })
    const year = props.firstWater.getFullYear()


    return (
        <div>
            <div>{day}</div>
            <div>{month}</div>
            <div>{year}</div>
        </div>
    );

}

export default FirstWater;
